  return (
    <div className="Settingsr">
    <div className= "sidebar">
      <Sidebar />
    </div>
    <div className="header navbar">
            <Navbar />
                    
                </div>
    <div className="content-center">
      <h1>Settings</h1>
      </div>
     
    </div>
  
  
  );
}


export default Settings;
